  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 2
  HDL_Counter_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        count_Weights <= to_unsigned(16#0#, 2);
      ELSIF enb = '1' THEN
        IF valid = '1' THEN 
          IF count_Weights >= to_unsigned(16#2#, 2) THEN 
            count_Weights <= to_unsigned(16#0#, 2);
          ELSE 
            count_Weights <= count_Weights + to_unsigned(16#1#, 2);
          END IF;
        END IF;
      END IF;
    END IF;
  END PROCESS HDL_Counter_process;


  dataIn_signed <= signed(dataIn);

  Delay_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay_out1 <= to_signed(16#0000#, 16);
      ELSIF enb = '1' THEN
        Delay_out1 <= dataIn_signed;
      END IF;
    END IF;
  END PROCESS Delay_process;


  Delay1_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay1_out1 <= '0';
      ELSIF enb = '1' THEN
        Delay1_out1 <= valid;
      END IF;
    END IF;
  END PROCESS Delay1_process;



  validOut <= adder_0_out2;

  dataOut <= Vector_Concatenate_out1;

END rtl;

